import React from "react";
import "../styles/Common.css";

const StockTable = ({ stocks, excludeKeys = [] }) => {
    const filteredKeys = stocks.length > 0 ? Object.keys(stocks[0]).filter((key) => !excludeKeys.includes(key)) : [];

    return (
        <div className="table-container">
            {stocks.length === 0 ? (
                <p className="error-message">표시할 데이터가 없습니다.</p>
            ) : (
                <table>
                    <thead>
                        <tr>
                            {filteredKeys.map((key, index) => (
                                <th key={index}>{key}</th>
                            ))}
                        </tr>
                    </thead>
                    <tbody>
                        {stocks.map((stock, index) => (
                            <tr key={index}>
                                {filteredKeys.map((key, idx) => (
                                    <td key={idx}>{stock[key]}</td>
                                ))}
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
};

export default StockTable;
